// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./InstantWallet.sol";
import "./NullWallet.sol";
import "./interfaces/IProRataFactory.sol";

contract ProRataFactory is IProRataFactory {
    mapping(address => Wallet[]) AllWallets;
    mapping(address => address[]) SharedWallets;
    mapping(address => bool) Initialized;

    uint256 public AllWalletsCount = 0;

    function getAddress(
        address _creator,
        address _reciever,
        string memory _password,
        uint _serial
    ) public view returns (address) {
        // address owner = msg.sender;
        bytes memory byteCode = type(NullWallet).creationCode;
        bytes32 salt = keccak256(
            abi.encodePacked(_reciever, _password, _serial, _creator)
        );

        bytes32 hash = keccak256(
            abi.encodePacked(
                bytes1(0xff),
                address(this),
                salt,
                keccak256(byteCode)
            )
        );

        return address(uint160(uint(hash)));
    }

    function createNullWallet(
        address _reciever,
        string memory _password,
        uint _serial
    ) public {
        address addr;
        address owner = msg.sender;
        bytes memory byteCode = type(NullWallet).creationCode;
        bytes32 salt = keccak256(
            abi.encodePacked(_reciever, _password, _serial, owner)
        );
        bytes32 hash = keccak256(
            abi.encodePacked(
                bytes1(0xff),
                address(this),
                salt,
                keccak256(byteCode)
            )
        );

        address calculated_addr = address(uint160(uint(hash)));
        require(!Initialized[calculated_addr], "Wallet Initialized before!");
        assembly {
            addr := create2(0, add(byteCode, 32), mload(byteCode), salt)
            if iszero(extcodesize(addr)) {
                revert(0, 0)
            }
        }
        INullWallet(addr).Initialize(_reciever, owner);
        Initialized[addr] = true;
    }

    function WithdrawFromNullWallet(
        address _walletAddress,
        address _token
    ) public {
        require(Initialized[_walletAddress], "Wallet not Initialized");
        INullWallet(_walletAddress).Withdraw(_token);
    }

    /**
     * @dev Creates a new instant wallet with the given parameters.
     * @param _walletlist The list of addresses for the wallet participants.
     * @param _percent The corresponding percentage allocation for each participant.
     * @param _name The name of the new wallet.
     * @return _newWallet The address of the newly created wallet.
     */
    function createInstantWallet(
        address[] memory _walletlist,
        uint256[] memory _percent,
        string memory _name
    ) public returns (address _newWallet) {
        address owner = msg.sender;
        address addr;
        uint256 total = 0;

        // Entry Checks
        require(_walletlist.length == _percent.length, "Invalid Input");
        require(_walletlist.length > 0, "Invalid wallet list length");
        require(bytes(_name).length > 0, "Invalid name length");

        for (uint256 index = 0; index < _walletlist.length; index++) {
            require(_walletlist[index] != address(0), "Invalid Input");
        }

        for (uint256 p = 0; p < _percent.length; p++) {
            require(_percent[p] > 0, "Percent must be greater than 0");
            total = total + _percent[p];
        }
        require(total == 100, "Total Percent must be 100");

        bytes memory byteCode = type(InstantWallet).creationCode;
        bytes32 salt = keccak256(
            abi.encodePacked(_name, AllWalletsCount, owner)
        );

        assembly {
            addr := create2(0, add(byteCode, 32), mload(byteCode), salt)
            if iszero(extcodesize(addr)) {
                revert(0, 0)
            }
        }

        IInstantWallet(addr).Initialize(_walletlist, _percent, _name, owner);
        AllWallets[msg.sender].push(Wallet(_name, address(addr), "instant"));

        for (uint256 index = 0; index < _walletlist.length; index++) {
            SharedWallets[_walletlist[index]].push(address(addr));
        }

        AllWalletsCount++;
        return addr;
    }

    function getSharedWallets()
        public
        view
        returns (address[] memory _wallets)
    {
        return SharedWallets[msg.sender];
    }

    function getUserWalletsCount() public view returns (uint256 _count) {
        return AllWallets[msg.sender].length;
    }

    function getUserWallets() public view returns (Wallet[] memory _wallets) {
        return AllWallets[msg.sender];
    }
}

